import { NavLink } from "react-router-dom";

export default function MovieMap(movie){
    return(
        <div>
            <NavLink to={`/movies`}></NavLink>
            <div>
                <img ref={movie.link}/>
                <h1>{movie.title}</h1>
                <p>{movie.overview}</p>
                <p>{movie.rating}</p>
                <p>{movie.genre}</p>
                <p>{movie.runtime}</p>
                <p>{movie.year}</p>
            </div>
        </div>
    );
}
